        double sum0 = 1.0, sum1 = 1.0;

        for(i=0; i<len; i++){

            sum0 += data1[i] * data1[i-j];

            sum1 += data1[i] * data1[i-j-1];

        }

        autoc[j  ] = sum0;

        autoc[j+1] = sum1;

    }



    if(j==lag){

        double sum = 1.0;

        for(i=0; i<len; i+=2){

            sum += data1[i  ] * data1[i-j  ]

                 + data1[i+1] * data1[i-j+1];

        }

        autoc[j] = sum;

    }

}

